var botaoAdicionar=document.querySelector("#buscar-pacientes");botaoAdicionar.addEventListener("click",function(){var t=new XMLHttpRequest;t.open("GET","https://api-pacientes.herokuapp.com/pacientes"),t.addEventListener("load",function(){var e=document.querySelector("#erro-ajax");if(200==t.status){e.classList.add("invisivel");var a=t.responseText;JSON.parse(a).forEach(function(e){adicionaPacienteNaTabela(e)})}else e.classList.remove("invisivel")}),t.send()});